namespace uddiorg.api_v3 {

    /// <summary>
    /// This class is hand made to handle the disposition report in the fault.
    /// </summary>
    public class DispositionReportFaultConverter {
        /// <summary>
        /// Takes the untyped fault exception and generates a typed one in the disposition 
        /// report context
        /// </summary>
        /// <param name="faultException"></param>
        /// <returns></returns>
        public static FaultException<DispositionReport> Convert(FaultException faultException) {
            MessageFault mf = faultException.CreateMessageFault();
            XmlReader xr = mf.GetReaderAtDetailContents();
            XmlSerializer serializer = new XmlSerializer(typeof(DispositionReport));
            DispositionReport dispositionReport = (DispositionReport)serializer.Deserialize(xr);
            return new FaultException<DispositionReport>(dispositionReport, faultException.Reason, faultException.Code, faultException.Action);
        }
    }

    /// <summary>
    /// This class is hand made to handle the disposition report in the fault.
    /// </summary>
    [XmlRoot("dispositionReport", Namespace = "urn:uddi-org:api_v3")]
    public class DispositionReport {
        private Result result;
        private string errCode;
        private string errInfo;

        [XmlElement("result")]
        public Result Result {
            get { return result; }
            set { result = value; }
        }

        public string ErrCode {
            get { return errCode; }
            set { errCode = value; }
        }

        
        public string ErrInfo {
            get { return errInfo; }
            set { errInfo = value; }
        }

        public override string ToString() {
            return "dispositionReport[result=" + result + "]";
        }
    }

    /// <summary>
    /// This class is hand made to handle the disposition report in the fault.
    /// </summary>
    public class Result {
        private string errno;
        private string keyType;
        private ErrInfo errInfo;

        [XmlAttribute("errno")]
        public string Errno {
            get { return errno; }
            set { errno = value; }
        }

        [XmlAttribute("keyType")]
        public string KeyType {
            get { return keyType; }
            set { keyType = value; }
        }

        [XmlElement("errInfo")]
        public ErrInfo ErrInfo {
            get { return errInfo; }
            set { errInfo = value; }
        }

        public override string ToString() {
            return "Result[errno=" + errno + " keyType=" + keyType + " errInfo=" + errInfo + "]";
        }
    }

    /// <summary>
